import React, { Component } from 'react';
import TopBar from '../TopBar';
import MainLayout from '../MainLayout';
import Facilities from '../Facilities';

class Home extends Component {
  render() {
    return (
      <div>
        <TopBar />
        <div>
        <MainLayout />
        <Facilities />
        </div>
      </div>
    );
  }
}

export default Home;
